import{_ as a,c as o,o as t,aA as i}from"./chunks/framework.DeGBEdhm.js";const y=JSON.parse('{"title":"SINDBAD Types: what comes from where","description":"","frontmatter":{},"headers":[],"relativePath":"pages/develop/sindbad_types.md","filePath":"pages/develop/sindbad_types.md","lastUpdated":null}'),s={name:"pages/develop/sindbad_types.md"};function r(d,e,n,p,l,c){return t(),o("div",null,[...e[0]||(e[0]=[i('<h1 id="SINDBAD-Types:-what-comes-from-where" tabindex="-1">SINDBAD Types: what comes from where <a class="header-anchor" href="#SINDBAD-Types:-what-comes-from-where" aria-label="Permalink to &quot;SINDBAD Types: what comes from where {#SINDBAD-Types:-what-comes-from-where}&quot;">​</a></h1><p>This page serves as an overview of the type definitions used across the SINDBAD ecosystem.</p><ul><li><p><strong>Sindbad (this repository)</strong>: types defined under <code>src/Types/</code></p></li><li><p><strong>Related packages</strong>: types that are not defined in <code>Sindbad/src/Types</code>, but are used/re-exported by SINDBAD (e.g. <code>SindbadTEM</code>, <code>TimeSamplers</code>, <code>ErrorMetrics</code>, <code>OmniTools</code>)</p></li></ul><h2 id="Types-defined-in-Sindbad-this-repository" tabindex="-1">Types defined in <code>Sindbad</code> (this repository) <a class="header-anchor" href="#Types-defined-in-Sindbad-this-repository" aria-label="Permalink to &quot;Types defined in `Sindbad` (this repository) {#Types-defined-in-Sindbad-this-repository}&quot;">​</a></h2><h2 id="Types.jl" tabindex="-1">Types.jl <a class="header-anchor" href="#Types.jl" aria-label="Permalink to &quot;Types.jl {#Types.jl}&quot;">​</a></h2><p><strong>Main module file that defines the core type system and includes type definitions for SINDBAD.</strong></p><p>This file establishes the <code>purpose</code> function, which provides descriptive information about types in the SINDBAD framework. It defines the base <code>SindbadTypes</code> abstract type from which all other SINDBAD types inherit. The file includes all other type definition files and provides documentation for the type system.</p><p>The sections below list <strong>only the type-definition files that are currently included by</strong> <code>src/Types/Types.jl</code> (i.e. what the <code>Sindbad.Types</code> module loads).</p><h2 id="LandTypes.jl" tabindex="-1">LandTypes.jl <a class="header-anchor" href="#LandTypes.jl" aria-label="Permalink to &quot;LandTypes.jl {#LandTypes.jl}&quot;">​</a></h2><p><strong>Defines types for land model data structures and helpers.</strong></p><p>This file defines the <code>LandTypes</code> abstract type and its subtypes, which provides types for handling SINDBAD <code>land</code> and how the model output in every time step is organized:</p><ul><li><p><code>PreAlloc</code>: Types for preallocating memory for model outputs</p></li><li><p><code>LandWrapper</code>: A wrapper for nested data structures with dot notation access</p></li><li><p><code>GroupView</code>: For accessing groups of data within a <code>LandWrapper</code></p></li><li><p><code>ArrayView</code>: For accessing specific arrays within groups</p></li></ul><p>Includes methods for pretty-printing and accessing data in these structures.</p><h2 id="ArrayTypes.jl" tabindex="-1">ArrayTypes.jl <a class="header-anchor" href="#ArrayTypes.jl" aria-label="Permalink to &quot;ArrayTypes.jl {#ArrayTypes.jl}&quot;">​</a></h2><p><strong>Defines array types used throughout the SINDBAD framework.</strong></p><p>This file defines <code>ArrayTypes</code> and contains two main categories of array types:</p><ul><li><p><code>ModelArrayType</code>: For internal model variables (standard arrays, static arrays, views)</p></li><li><p><code>OutputArrayType</code>: For model outputs (standard arrays, MArrays, SizedArrays, YAXArrays)</p></li></ul><p>These types control how data is stored and manipulated within the model and output processes.</p><h2 id="InputTypes.jl" tabindex="-1">InputTypes.jl <a class="header-anchor" href="#InputTypes.jl" aria-label="Permalink to &quot;InputTypes.jl {#InputTypes.jl}&quot;">​</a></h2><p><strong>Defines types for handling input data and processing.</strong></p><p>This file defines the <code>InputTypes</code> abstract type and its subtypes, which includes types for:</p><ul><li><p>Data backends: <code>BackendNetcdf</code>, <code>BackendZarr</code></p></li><li><p>Input array types: <code>InputArray</code>, <code>InputKeyedArray</code>, <code>InputNamedDimsArray</code>, <code>InputYaxArray</code></p></li><li><p>Forcing variable types: <code>ForcingWithTime</code>, <code>ForcingWithoutTime</code></p></li><li><p>Spatial subsetting methods: <code>Spaceid</code>, <code>Spacelatitude</code>, <code>Spacelon</code>, etc.</p></li></ul><p>These types control how input data is loaded and processed.</p><h2 id="SimulationTypes.jl" tabindex="-1">SimulationTypes.jl <a class="header-anchor" href="#SimulationTypes.jl" aria-label="Permalink to &quot;SimulationTypes.jl {#SimulationTypes.jl}&quot;">​</a></h2><p><strong>Defines types for experiment configuration and execution.</strong></p><p>This file defines the <code>SimulationTypes</code> abstract type and its subtypes, which contains types for controlling model runs:</p><ul><li><p><code>RunFlag</code>: Boolean flags for various model behaviors (e.g., <code>DoSpinupTEM</code>, <code>DoSaveInfo</code>)</p></li><li><p><code>ParallelizationPackage</code>: Options for parallelization (<code>ThreadsParallelization</code>, <code>QbmapParallelization</code>)</p></li><li><p><code>OutputStrategy</code>: Controls for model output behavior (<code>DoOutputAll</code>, <code>DoSaveSingleFile</code>)</p></li></ul><p>These types configure how model experiments are executed.</p><h2 id="ParameterOptimizationTypes.jl" tabindex="-1">ParameterOptimizationTypes.jl <a class="header-anchor" href="#ParameterOptimizationTypes.jl" aria-label="Permalink to &quot;ParameterOptimizationTypes.jl {#ParameterOptimizationTypes.jl}&quot;">​</a></h2><p><strong>Defines types for model optimization and parameter estimation.</strong></p><p>This file defines the <code>ParameterOptimizationTypes</code> abstract type and its subtypes, which includes:</p><ul><li><p><code>ParameterOptimizationMethod</code>: Various optimization algorithms (BFGS, CMA-ES, Nelder-Mead, etc.)</p></li><li><p><code>GSAMethod</code>: Global sensitivity analysis methods (Morris, Sobol)</p></li><li><p><code>CostMethod</code>: Methods for calculating cost between model and observations</p></li><li><p><code>ParameterScaling</code>: Methods for scaling parameters during optimization</p></li></ul><p>These types control how model parameters are optimized.</p><h2 id="MachineLearningTypes.jl" tabindex="-1">MachineLearningTypes.jl <a class="header-anchor" href="#MachineLearningTypes.jl" aria-label="Permalink to &quot;MachineLearningTypes.jl {#MachineLearningTypes.jl}&quot;">​</a></h2><p><strong>Defines types for machine learning and gradient calculations.</strong></p><p>This file defines <code>MachineLearningTypes</code> abstract type and its subtypes, which focuses on gradient calculation methods:</p><ul><li><p><code>MachineLearningGradType</code>: Abstract type for gradient calculation methods</p></li><li><p>Various automatic differentiation methods: <code>ForwardDiffGrad</code>, <code>ZygoteGrad</code>, <code>EnzymeGrad</code></p></li><li><p>Finite difference methods: <code>FiniteDiffGrad</code>, <code>FiniteDifferencesGrad</code></p></li></ul><p>These types control how gradients are calculated for optimization.</p><h2 id="Types-from-related-packages-used/re-exported-by-SINDBAD" tabindex="-1">Types from related packages (used/re-exported by SINDBAD) <a class="header-anchor" href="#Types-from-related-packages-used/re-exported-by-SINDBAD" aria-label="Permalink to &quot;Types from related packages (used/re-exported by SINDBAD) {#Types-from-related-packages-used/re-exported-by-SINDBAD}&quot;">​</a></h2><h3 id="SindbadTEM-package" tabindex="-1">SindbadTEM (package) <a class="header-anchor" href="#SindbadTEM-package" aria-label="Permalink to &quot;SindbadTEM (package) {#SindbadTEM-package}&quot;">​</a></h3><p>Defines the core TEM model type hierarchy for SINDBAD (e.g. <code>LandEcosystem</code>) and associated TEM-level tooling.</p><h3 id="TimeSamplers.jl-package" tabindex="-1">TimeSamplers.jl (package) <a class="header-anchor" href="#TimeSamplers.jl-package" aria-label="Permalink to &quot;TimeSamplers.jl (package) {#TimeSamplers.jl-package}&quot;">​</a></h3><p>Defines time-related types for temporal subsetting and aggregation:</p><ul><li><code>TimeSampler</code> and a comprehensive set of time scales/aggregations (e.g. <code>TimeDay</code>, <code>TimeMonth</code>, <code>TimeYear</code>, MSC/anomaly aggregations, etc.)</li></ul>',44)])])}const u=a(s,[["render",r]]);export{y as __pageData,u as default};
